import React from 'react';
import ReactDOM from 'react-dom';

class MyMain extends React.Component{
constructor(props){
    super(props);
}

render(){
    return(
<div>
            <h1>Il nostro menu'</h1>
            {this.props.menu.map((item)=><li>{item}</li>)}
        </div> );
}

}
export default MyMain;
